#!/usr/bin/env perl
use strict;
use warnings;

=head1 LIVING TREE SELF-EXTRACTING ARCHIVE

This script contains the complete Living Tree workspace encoded as BASE32.
Just run it and it extracts everything!

Usage: perl living_tree_self_extracting.pl

The workspace will be extracted to the current directory.

=cut

print "=" x 70 . "\n";
print "🌳 Living Tree Self-Extracting Archive 🌳\n";
print "=" x 70 . "\n\n";
print "Extracting workspace...\n";

my $base32_data = '
';

# Clean and decode
$base32_data =~ s/\s+//g;

open my $decoder, '|-', 'base32 -d | tar -xJ' or die "Cannot start decoder: $!\n";
print $decoder $base32_data;
close $decoder;

if ($? == 0) {
    print "\n" . "=" x 70 . "\n";
    print "✓ Living Tree workspace extracted successfully!\n";
    print "=" x 70 . "\n\n";
    
    if (-d 'core') {
        print "Workspace structure:\n";
        print "  ├── core/                    ← Core implementations\n";
        print "  ├── implementations/         ← Working demos\n";
        print "  ├── documentation/          ← Guides\n";
        print "  └── archives/               ← Backups\n\n";
        print "Quick start:\n";
        print "  cd core\n";
        print "  perl base32_harmonic_routing.pl\n\n";
        print "🌳 The Living Tree has grown! 🌳\n";
    } else {
        print "Files extracted to current directory.\n";
    }
} else {
    print "\n✗ Extraction failed!\n";
    print "Make sure base32 and xz-utils are installed.\n";
    exit 1;
}
